import { Link } from "react-router-dom";
import "./nav.css";

function menuToggle() {
  const toggleMenu = document.querySelector(".sidebar");
  toggleMenu.classList.toggle("show-sidebar");
}

const Navbar = () => {
  return (
    <div>
      <nav>
        <div className="nav-end">
          <img
            className="burger"
            src="/img/menu.png"
            id="menu"
            onClick={menuToggle}
          ></img>
          <Link to="/">
            <h2>HowTo</h2>
          </Link>
        </div>

        <div className="nav-end">
          <Fragment>
            <Link to="/createpost">
              <h2>Create Post</h2>
            </Link>
          </Fragment>
        </div>
      </nav>
    </div>
  );
};

export default Navbar;
